VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'About Diabetes Understanding Type 2 Diabetes What is Type 2 Diabetes?In type 2 diabetes, your body does not use insulin properly—this is called insulin resistance. At first, your beta cells make extra insulin to make up for it. Over time, your pancreas can’t make enough insulin to keep your blood glucose at normal levels. Type 2 diabetes develops most often in middle-aged and older adults but is increasing in young people.Treatment for people with type 2 diabetes will include healthy eating and exercise. However, your health care provider may need to also prescribe oral and injectable medications (including insulin) to help you meet your target blood glucose levels.Symptoms of Type 2 DiabetesThe following symptoms of diabetes are typical. However, some people with type 2 diabetes have symptoms so mild that they go unnoticed.', '{-0.017328985035419464,-0.9405919909477234,0.07479546219110489,0.3580581247806549,7.318865391425788e-05,0.6365189552307129,0.6489831805229187,0.5692209601402283,0.7210232019424438,-0.17875245213508606,0.7722793817520142,0.6059849262237549,-0.5716223120689392,-0.6221474409103394,-0.8742061853408813,-0.46742209792137146,0.34641823172569275,0.8164896368980408,-0.031156150624155998,-0.004036078229546547,0.03130931034684181,-0.3051305115222931,-0.255669504404068,-0.5036401748657227,-0.2738189697265625,0.11981160193681717,-0.6168073415756226,-0.20039236545562744,-0.11337727308273315,0.2964908182621002,-0.5614206790924072,0.04309169948101044,0.33604592084884644,0.5187708735466003,-0.08518947660923004,-0.20230045914649963,-0.46593526005744934,0.8351906538009644,0.5251628160476685,-0.11070577800273895,0.3092398941516876,0.44265058636665344,0.22499720752239227,-0.11490079015493393,-0.2114127278327942,0.38715100288391113,0.6620814800262451,0.3693934381008148,0.18935033679008484,-0.03049890510737896,0.01821044087409973,-0.39219895005226135,0.3878776729106903,0.10895498842000961,-0.37