VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'are typical. However, some people with type 2 diabetes have symptoms so mild that they go unnoticed.Common symptoms of diabetes:Urinating oftenFeeling very thirstyFeeling very hungry—even though you are eatingExtreme fatigueBlurry visionCuts/bruises that are slow to healTingling, pain, or numbness in the hands/feet Early detection and treatment of diabetes can decrease the risk of developing the complications of diabetes.Although there are many similarities between type 1 and type 2 diabetes, the cause of each is very different. And the treatment is usually quite different, too. Some people, especially adults who are newly diagnosed with type 1 diabetes, may have symptoms similar to type 2 diabetes and this overlap between types can be confusing. Take our Risk Test to find out if you are at increased risk for having type 2 diabetes.', '{0.34156978130340576,-0.9226113557815552,0.016462037339806557,0.3115925192832947,-0.09144505858421326,0.5511032938957214,0.6163523197174072,0.5172269940376282,0.8516184091567993,-0.12990468740463257,0.30604061484336853,0.8454912304878235,-0.5771734714508057,-0.6474464535713196,-0.6666245460510254,-0.36616504192352295,0.3545738458633423,0.6116783618927002,0.016534259542822838,-0.3347654342651367,-0.13565757870674133,-0.3711194694042206,-0.413997620344162,-0.3419070839881897,-0.24973614513874054,-0.05161541327834129,-0.4784901738166809,-0.30291128158569336,0.14363737404346466,0.1620539277791977,-0.525290310382843,-0.11143586039543152,0.41110751032829285,0.32750242948532104,-0.1539451777935028,-0.17455537617206573,-0.30077487230300903,1.183003306388855,0.6170166730880737,-0.5515667200088501,0.0615723691880703,0.4727042615413666,0.34851542115211487,-0.6990630626678467,-0.23720377683639526,0.42857956886291504,0.8236400485038757,0.26736295223236084,0.4971044659614563,0.0562601201236248,-0.27593860030174255,-0.25266698002815247,0.3066366910934448,0.24523724615573883,-0.5