VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Chronic Obstructive Pulmonary Disease (COPD) Can we help you find more info? Start by selecting which best describes you. Select your persona I am... interested in learning about COPD newly diagnosed living with COPD a caregiver an educator/health professional Facebook Twitter LinkedIn Email Print Chronic obstructive pulmonary disease (COPD), which includes chronic bronchitis and emphysema, is a long-term lung disease that makes it hard to breathe. The good news is COPD is often preventable and treatable.  Here you''ll find information, resources and tools to help you understand COPD, manage treatment and lifestyle changes, find support and take action. What you need to know about COPD Find out how COPD affects the airways, what causes it and different types of COPD. What to do after a COPD diagnosis Learn important treatment information such as how to use your COPD medicines and develop a COPD action plan.', '{0.30477866530418396,-1.1338008642196655,0.554397463798523,-0.4248063564300537,0.3673776686191559,1.213384985923767,0.3285145163536072,-0.3244419991970062,-0.20798854529857635,-0.3553025722503662,-0.08224330842494965,0.22653226554393768,0.18649496138095856,-0.3961574137210846,-0.6024659872055054,-0.32823988795280457,0.11056399345397949,0.010846653021872044,0.4622204303741455,0.1572028249502182,-0.7112385630607605,-0.2548806369304657,-0.6232397556304932,-0.4187524914741516,-0.6448067426681519,0.32759591937065125,-1.05034339427948,-0.10070567578077316,0.28640323877334595,0.0911867544054985,-0.7057501077651978,0.18525312840938568,-0.41241583228111267,0.28997254371643066,-0.473468154668808,0.014776992611587048,0.2984893321990967,0.5526431798934937,-0.35413801670074463,0.013760607689619064,0.13127514719963074,1.0890355110168457,-0.44934600591659546,0.3610565662384033,-0.22498227655887604,0.503719687461853,0.3494897484779358,0.05832231044769287,0.4265573024749756,0.1994168758392334,-0.2737609744