VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'are less likely to be cheered, comforted or consoled. What does ''high-functioning depression" mean? The term “high-functioning depression” underscores the reality that many individuals with depression face – going through the motions of their day to day lives, appearing normal on the surface, while silently struggling with symptoms of depression. However, it is critical to note that though this term has gained prominence on various social media platforms and may be helping to lessen the stigma of depression, it is not a specific medical diagnosis. Once a person has been diagnosed and treated for depression, is it likely to return? Among people who are treated for major depressive disorder and recover, at least half are likely to experience a recurrent episode sometime in their future.It is difficult to determine at what point this may occur or what circumstances, if any, may trdigger it.', '{-0.2806651294231415,0.1877458244562149,0.37929466366767883,-0.3063814043998718,-0.20944564044475555,0.45185720920562744,-0.3855276107788086,0.3706977665424347,-0.3440237045288086,-0.19883275032043457,0.10585102438926697,0.06568547338247299,-0.17983782291412354,-0.09166954457759857,-0.2757754623889923,0.5262154936790466,1.2930570840835571,-0.1421259641647339,0.00021871367061976343,-0.22010387480258942,-1.2945548295974731,-0.43598243594169617,-0.3375498950481415,-0.6207642555236816,-0.28073519468307495,0.4060945510864258,-0.4851304888725281,-0.9963304996490479,-0.4560982286930084,0.35682547092437744,-0.6985755562782288,0.2750108540058136,-0.29836058616638184,0.10145244002342224,-0.1927192360162735,-0.6829395294189453,0.27686208486557007,0.4239156246185303,0.4583340287208557,-0.4296332597732544,0.01701500080525875,-0.42336776852607727,-0.325218141078949,0.24653016030788422,-0.6333808302879333,0.34337887167930603,-0.06812070310115814,0.1329399198293686,0.6641064286231995,0.13032108545303345,0.05556917190551758,