VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Learn about anxiety disorders, including symptoms, risk factors, treatment options and answers to your questions. Anxiety is a normal reaction to stress. Mild levels can be beneficial in some situations. It can alert us to dangers and help us prepare and pay attention. Anxiety disorders differ from normal feelings of nervousness or anxiousness and involve excessive fear or anxiety. Anxiety disorders are the most common of mental disorders and affect nearly 30 percent of adults at some point in their lives. Anxiety disorders can cause people into try to avoid situations that trigger or worsen their symptoms. Job performance, schoolwork and personal relationships can be affected. However, anxiety disorders are treatable with a number of psychotherapeutic treatments. Treatment helps most people lead normal productive lives.', '{-0.737389862537384,-0.18538761138916016,0.6872293949127197,-0.3739969730377197,0.3937678933143616,0.424476683139801,-0.27240148186683655,-0.04829565808176994,-0.05602800101041794,-0.5154881477355957,0.2997444272041321,0.36998143792152405,-0.3696275055408478,-0.7902860045433044,-0.3217145502567291,0.43348419666290283,0.10016845911741257,0.07621435821056366,-0.6076364517211914,0.48183780908584595,-0.2076522409915924,-0.555699348449707,-0.47231432795524597,-0.5153902173042297,-0.1908179074525833,-0.3009083867073059,-0.4953501522541046,-0.6581522226333618,-0.6979253888130188,0.5794761180877686,-0.20193222165107727,0.09658341109752655,0.0495205819606781,-0.22689616680145264,-0.29887181520462036,-0.41347038745880127,-0.3263942301273346,0.5419407486915588,-0.07769855856895447,0.08056814968585968,0.3906877934932709,-0.3172536790370941,-0.8003283143043518,-0.4783223271369934,-0.1504381150007248,-0.04380326345562935,0.7246248126029968,0.08037351071834564,0.47343334555625916,0.46577757596969604,-0.0650496855378151,-0.15506690740585327,-0.1252826452255249,0.23260360956192017,0.243184372