VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'lies,” jitteriness, accompanied by a sense of unease) to severe (frequent, disabling panic attacks). Severe anxiety disorders can lead someone to alter his or her lifestyle to accommodate the anxiety, for example avoiding activities. When anxiety begins to cause dysfunction in your daily life, that’s when it’s time to consider it’s more than normal anxiety. Can meditation or other relaxation techniques help with my anxiety? Relaxation techniques and meditation can certainly help with your anxiety. In fact, non-medication options are the first-line treatment for the mild anxiety that most of us experience from time to time. There are many books, online resources, and apps with relaxation exercises (often paired with deep breathing) and meditation guidance. They are relatively simple to learn, yet highly effective. These approaches can provide relief and can be used anywhere once the person understands the method.', '{-0.6655125617980957,0.012105889618396759,0.2545987367630005,-0.486461341381073,0.5004807114601135,0.05725392326712608,-0.5554949641227722,-0.30724501609802246,0.2890908122062683,-0.6118329167366028,0.3236563503742218,-0.11219745874404907,0.0016018034657463431,-0.8433851599693298,-0.5163514018058777,0.4440033733844757,-0.6732144355773926,-0.325967401266098,-0.49192580580711365,0.521073043346405,-0.46574124693870544,-0.11855611950159073,-0.18512819707393646,-0.31616273522377014,0.1197064146399498,-0.11477521061897278,-0.48672375082969666,-0.4790930151939392,-0.38982728123664856,0.42097485065460205,-0.24843356013298035,0.14300960302352905,-0.18117259442806244,0.009443361312150955,-0.6425517797470093,-1.0074087381362915,-0.5272101759910583,0.4723111689090729,0.12395253032445908,0.2855558693408966,0.22495615482330322,0.3209863305091858,-0.9984285235404968,-0.3083973526954651,-0.5912033915519714,-0.1361570507287979,0.42782148718833923,0.06113242730498314,0.0021626544184982777,0.49345374107