VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'First Aid On this page Basics Summary Start Here Learn More Specifics See, Play and Learn Images Research Clinical Trials Journal Articles Resources Find an Expert For You Children Patient Handouts Summary Accidents happen. Someone chokes on an ice cube or gets stung by a bee. It is important to know when to call 911 -- it is for life-threatening emergencies. While waiting for help to arrive, you may be able to save someone''s life. Cardiopulmonary resuscitation (CPR) is for people whose hearts or breathing has stopped and the Heimlich maneuver is for people who are choking. You can also learn to handle common injuries and wounds. Cuts and scrapes, for example, should be rinsed with cool water. To stop bleeding, apply firm but gentle pressure, using gauze. If blood soaks through, add more gauze, keeping the first layer in place. Continue to apply pressure. It is important to have a first aid kit available. Keep one at home and one in your car. It should include a first-aid guide.', '{-1.0828418731689453,0.23185427486896515,0.1106615960597992,-1.0186926126480103,-0.27781519293785095,0.9197412133216858,-0.16672439873218536,-0.27248725295066833,-0.029071586206555367,-0.16364288330078125,0.5071294903755188,0.43637803196907043,-0.3923526704311371,-0.5386945605278015,-0.4386308789253235,0.11856541037559509,-0.189168781042099,-0.40132808685302734,-0.5359998941421509,0.5553399324417114,-0.18370212614536285,-0.26325440406799316,-0.3487953841686249,0.3949793875217438,0.8280053734779358,0.5322807431221008,-0.6186572909355164,-0.41107118129730225,0.20528148114681244,0.7123368382453918,-0.9757647514343262,-0.6166015267372131,0.004967531189322472,0.5683966279029846,-0.6295574903488159,-0.20809245109558105,-0.4248066246509552,0.34785008430480957,0.3783034086227417,-0.19483958184719086,0.5399850010871887,0.21224096417427063,-0.7441450357437134,-0.2187645584344864,-0.6563056111335754,-0.13875271379947662,-0.0808