VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Opioid dependence is a chronic condition that can lead to significant harm if left untreated. People who experience opioid dependence and the treatments themselves are highly stigmatised. Person-centred trauma-informed services are critical to therapeutic engagement and effectiveness. Buprenorphine and methadone are highly effective, evidence-based medicines for opioid dependence. In recent years, long-acting injectable buprenorphine has emerged as a safe and effective treatment option, offering flexible weekly or monthly dosing. The long-term treatment of opioid dependence can be undertaken in primary care settings. General practitioner and nurse practitioner prescribing, and community pharmacist dispensing, are essential for ongoing care. Australian jurisdictions have differing regulations that guide the prescribing of medicines for opioid dependence. Health professionals should be familiar with their local jurisdiction’s guidelines as well as the national guidelines.', '{0.5786200761795044,-0.20156359672546387,0.10076826810836792,0.23137906193733215,0.3585943877696991,0.10478508472442627,0.3747384548187256,-0.04337175935506821,-0.3969377875328064,-1.1573352813720703,0.3033905327320099,0.41399431228637695,0.23068499565124512,-0.4971335828304291,0.24194438755512238,0.047521233558654785,0.038599271327257156,1.1688721179962158,-0.1873456984758377,-0.35607966780662537,-0.4864574074745178,0.02308330498635769,-0.6398331522941589,0.2203834354877472,0.24856063723564148,-0.240737646818161,-0.3382159471511841,-0.5967435836791992,-0.21564562618732452,-0.13448010385036469,-0.8010927438735962,-0.053911853581666946,0.038994792848825455,-0.09467155486345291,-0.10058104991912842,-0.4237176775932312,0.17707161605358124,0.7205958366394043,-1.741895079612732,0.23943710327148438,-1.0734727382659912,1.2119426727294922,-0.11691294610500336,-0.8890403509140015,-0.37732580304145813,-0.4419585168361664,0.3737248778343