VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ls should be familiar with their local jurisdiction’s guidelines as well as the national guidelines. Drug and alcohol telephone services are available in each jurisdiction and can provide advice to health professionals. Opioid dependence is a chronic relapsing medical condition. According to the World Health Organization’s International Classification of Diseases 11th revision (ICD-11), the diagnosis of opioid dependence has 3 main facets: loss of control, salience, and physiological factors of neuroadaptation (tolerance and withdrawal) ( Diagnosis of opioid dependence requires 2 out of 3 of the following: People can develop opioid dependence from illicit and pharmaceutical opioids, both prescribed and non-prescribed. Opioid dependence is a stigmatised condition. The experience of stigma and discrimination adversely affects health and prevents people from disclosing behaviours and accessing or staying in treatment.', '{0.48722198605537415,-0.33161935210227966,0.3041854202747345,-0.027633681893348694,0.4695884883403778,0.36380884051322937,0.18026508390903473,0.15210214257240295,-0.6247135996818542,-1.1616052389144897,0.4977148473262787,0.28257352113723755,0.110235296189785,-0.12454080581665039,0.18773190677165985,0.018644018098711967,0.0040671927854418755,0.9259145259857178,0.23728248476982117,-0.3188883662223816,-0.7351141571998596,-0.3222990334033966,-0.760572612285614,0.3556497395038605,0.020604144781827927,-0.15842629969120026,-0.4220324456691742,-0.6067108511924744,-0.3715282380580902,0.1731112152338028,-0.675387442111969,0.012739717029035091,0.041376352310180664,0.15669682621955872,0.1430608183145523,-0.624289870262146,0.47907739877700806,0.033895187079906464,-1.4605344533920288,0.1585496962070465,-1.1842869520187378,0.8180187344551086,-0.3201039135456085,-0.7941189408302307,-0.5436690449714661,-0.42027807235717773,0.46278735995292664,-0.05164216086268425,0.26242053508758545,0.1972931474447