VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'affects health and prevents people from disclosing behaviours and accessing or staying in treatment. Opioid dependence treatment (ODT) with long-term prescribed opioids, such as buprenorphine or methadone, is highly effective and reduces the health, social and economic harms for people experiencing opioid dependence, In Australia, nearly 75% of ODT is provided in primary care settings. Most prescribers are general practitioners (GPs) with a small but increasing number of nurse practitioners (NPs). As ODT is highly effective, many people will greatly improve and can transition to ongoing treatment in primary care. Treatment in the primary care setting reduces stigma and enables better management of people’s general health care. A core role for primary care is the long-term management of people particularly whose ODT has stabilised.', '{0.5786450505256653,0.18542473018169403,0.4235670566558838,0.11735037714242935,0.06228844076395035,0.0008591278456151485,0.4333799481391907,0.012780653312802315,-0.46697795391082764,-1.1568050384521484,0.20514459908008575,0.5866296887397766,0.17588631808757782,-0.35087382793426514,0.3500444293022156,-0.08196552842855453,-0.05227961018681526,0.6711717247962952,0.12972533702850342,-0.2925233542919159,-0.580070972442627,0.0942646786570549,-0.605941116809845,-0.209731787443161,-0.5186399817466736,-0.5144167542457581,-0.31915855407714844,-0.4240495562553406,0.2927357852458954,-0.09793196618556976,-0.6281613707542419,-0.15475188195705414,-0.42443957924842834,0.0905638262629509,-0.10827978700399399,-0.42300674319267273,0.2868534028530121,0.7383707165718079,-1.4987118244171143,0.1294565051794052,-0.8000182509422302,0.9698570966720581,-0.45825445652008057,-0.5439638495445251,-0.12458889186382294,-0.5349887013435364,-0.0007816641009412706,0.0038913856260478497,-0.1888907551765442,0.05325635150074959,0.13341741263866425,-0.22095580399036407,0.2891739010810852,0.539003491401672