VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'e role for primary care is the long-term management of people particularly whose ODT has stabilised. Ensuring good connections and collaboration between GPs, NPs, community pharmacists and local AOD specialist settings for consultation, advice and support, which may be virtual, is essential. Planned opioid withdrawal may be suitable for people who are using low doses of opioids (i.e. oral morphine equivalent daily dose less than 60 mg) or have a short history of opioid dependence (weeks to months); however, this approach is associated with a high risk of relapse and overdose due to loss of opioid tolerance. It is essential to consider the optimal setting for withdrawal for each person. People with other morbidities, experiencing homelessness or needing intensive psychological support, may do better in a supported setting, for example, in a public or non-government drug and alcohol inpatient unit.', '{0.4320508539676666,-0.15660513937473297,0.5751314759254456,-0.20502416789531708,-0.18678775429725647,-0.13704003393650055,-0.06829274445772171,-0.2038998007774353,-0.639735758304596,-0.9350844621658325,0.6127992868423462,0.3859981596469879,-0.06897914409637451,-0.6215675473213196,-0.22920314967632294,-0.21219392120838165,-0.42509645223617554,0.6445533633232117,0.4825628697872162,-0.35562896728515625,-1.137616515159607,0.11784307658672333,-0.2016090601682663,-0.3281504511833191,-0.28597399592399597,-0.08873918652534485,-0.17283965647220612,-0.4847775399684906,0.3152977526187897,0.24873466789722443,-0.6162983179092407,0.18139873445034027,-0.3851417005062103,0.5479660630226135,0.3422356843948364,-0.5966787934303284,0.20663848519325256,0.5672057271003723,-1.6532299518585205,-0.09515555202960968,-0.7740263342857361,0.6579955220222473,-0.46120011806488037,-0.30225399136543274,-0.6843589544296265,-0.44007202982902527,-0.1382494419813156,-0.19882157444953918,-0.1672319620847702,0.5991783142089844,0.26059225