VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'in a supported setting, for example, in a public or non-government drug and alcohol inpatient unit. For support and more information, contact the AOD specialist advisory service in your jurisdiction. Medicines approved in Australia for the treatment of opioid dependence include methadone and buprenorphine ( ODT requires supervised medication administration (dosing). This can occur in drug and alcohol clinics, and in hospital or community pharmacies. Generally, people who commence oral or sublingual therapies will start with daily supervised dosing and be given doses to take away, to administer themselves at home, once they are stable in treatment. Stability is indicated by stable social conditions, stable physical and mental health, no high-risk drug use, attendance at planned appointments and good adherence to medication. Safe storage of takeaway medicines to prevent child poisoning is important.', '{0.059048961848020554,-0.08463884145021439,0.11385640501976013,0.243076354265213,0.024748975411057472,0.1445440798997879,-0.38457024097442627,-0.05476713553071022,-0.22159378230571747,-1.3157964944839478,0.2631959021091461,0.4242352843284607,0.05846124887466431,-0.24021534621715546,0.19354283809661865,-0.04776869714260101,-0.0006814083317294717,0.6657961010932922,0.043862637132406235,-0.1172722801566124,-0.5522850155830383,-0.13701790571212769,-0.47000449895858765,-0.19232143461704254,0.22638365626335144,0.048091303557157516,-0.13371950387954712,-0.46447762846946716,0.11381500214338303,-0.15322858095169067,-0.5600638389587402,0.0668785497546196,-0.20879200100898743,0.6875066161155701,0.3096746802330017,-0.7625229954719543,0.06817881017923355,0.5871140360832214,-2.1214053630828857,-0.4462195038795471,-0.985870361328125,0.5592948198318481,-0.6254850029945374,-0.5262726545333862,-0.8851155638694763,-0.6120400428771973,0.05856006219983101,0.13856591284275055,-0.832159698009491,0.4738893210887909,-0.1883