VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'adherence to medication. Safe storage of takeaway medicines to prevent child poisoning is important. Generally, the choice of treatment should be a shared decision between the prescriber and the person seeking treatment, taking into account their unique needs, comorbidities, medications and preferences. Buprenorphine, a partial opioid agonist, has a high affinity for opioid receptors and only partially activates them. This means that if a person with opioid dependence has high concentrations of opioid agonists (e.g. morphine, heroin) in their body, adding buprenorphine will displace the other opioid from the receptors, triggering opioid withdrawal symptoms (a condition called precipitated withdrawal). In contrast, if an opioid-dependent person presents with opioid withdrawal symptoms, buprenorphine will relieve these.', '{0.6134011745452881,-0.034716613590717316,0.03749120235443115,0.055898260325193405,0.22983187437057495,-0.0942419171333313,-0.3638243079185486,0.16176992654800415,0.10705800354480743,-0.5900288820266724,0.4522520899772644,0.29217302799224854,-0.13058285415172577,-0.03190220147371292,-0.5058319568634033,0.17216436564922333,0.2078455686569214,0.6446264982223511,0.3080645501613617,-0.3993626534938812,-0.5371149778366089,0.19978363811969757,-0.43829289078712463,0.20208969712257385,0.3190351724624634,0.1977412849664688,-0.4320865571498871,-0.5921583771705627,-0.085767462849617,0.2848890721797943,-0.7378188967704773,0.09921035915613174,0.1261357069015503,0.35725221037864685,0.3887311816215515,-0.2352113425731659,0.0716247484087944,1.1064236164093018,-1.4663127660751343,-0.3022747039794922,-0.8586344718933105,0.7269977331161499,-0.2311377227306366,-0.5604379773139954,-0.5838489532470703,-0.4832194447517395,-0.10830303281545639,0.07381186634302139,-0.3206547200679779,-0.11525224894285202,-0.17293837666511536,-0.0455469973385334,-0.1534930020570755,0.12200168520212173,-0.4356116950511932