VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'opioid-dependent person presents with opioid withdrawal symptoms, buprenorphine will relieve these. Given the pharmacology of buprenorphine, care is needed to ensure that the person is in mild to moderate opioid withdrawal (COWS score of at least 10 to 15; refer to Appendix) before starting treatment to avoid precipitated withdrawal. Once above a certain daily dose, usually 16 mg, buprenorphine blocks the effects of other opioids, so it may be suitable for people who do not want to continue using other opioids. Buprenorphine may also assist with clarity of thought, making it a good option for those who need better cognitive function. Buprenorphine can be prescribed as a sublingual tablet or film and is usually combined with naloxone ( Long-acting injectable buprenorphine (LAIB) was first introduced in Australia in 2018. It is available as weekly or monthly subcutaneous injections.', '{0.7347855567932129,-0.0992065817117691,0.10896893590688705,0.12330110371112823,-0.047629326581954956,-0.0857243537902832,-0.25353944301605225,-0.28506705164909363,-0.08892499655485153,-0.8651617169380188,0.28941774368286133,0.00987162720412016,0.2037685364484787,-0.3513743579387665,-0.1275739073753357,-0.0036783942487090826,0.552898645401001,0.7598857879638672,0.44250646233558655,-0.4608863294124603,-0.8511725068092346,0.12871825695037842,-0.22319093346595764,0.03104499541223049,0.22719745337963104,0.3422563374042511,-0.3999957740306854,-0.3571788966655731,0.1645573526620865,0.12164901196956635,-0.8666873574256897,-0.13719236850738525,0.020270390436053276,0.2600615322589874,0.25538355112075806,-0.0751759484410286,0.049386557191610336,0.9446502923965454,-0.9794633388519287,0.0067596836015582085,-0.5377475023269653,0.8980963826179504,-0.15770281851291656,-0.40665581822395325,-0.5148228406906128,-0.19471107423305511,-0.3253318965435028,-0.09465150535106659,-0.057624366134405136,-0.05021880567073822,-0.0778732746839523