VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'first introduced in Australia in 2018. It is available as weekly or monthly subcutaneous injections. There are 2 formulations, with the trade names Buvidal and Sublocade ( Generally, sublingual buprenorphine+naloxone is started before transitioning the person to a LAIB. However, practice is evolving, and it is likely in the future that people may be started directly on a LAIB, with those who have not previously been exposed to buprenorphine receiving a test dose of sublingual buprenorphine+naloxone to exclude allergy prior to starting a LAIB. For further details on how to start LAIBs, refer to your jurisdiction’s guidelines. Methadone is a full opioid agonist ( There are 2 oral formulations of methadone: methadone syrup and Biodone liquid. Injected use is associated with infection and vein damage. Naltrexone is an opioid antagonist with limited use in ODT.', '{0.20539595186710358,-0.3774661719799042,-0.04191770777106285,-0.09410965442657471,0.2670643627643585,-0.08804867416620255,-0.3868016302585602,-0.019551867619156837,0.1287463903427124,-1.0907820463180542,0.16588221490383148,-0.1560535430908203,0.23269020020961761,-0.7496774792671204,-0.36943814158439636,-0.2889758348464966,0.21791769564151764,0.5488271713256836,0.21135368943214417,-0.38857653737068176,-0.7937493920326233,0.07991950958967209,-0.22787204384803772,-0.06134147197008133,0.30779126286506653,0.315424382686615,-0.15793977677822113,-0.533690869808197,0.3716886341571808,0.003872515866532922,-0.9158884882926941,-0.204776331782341,0.030950402840971947,0.26052284240722656,-0.007107076235115528,-0.27405092120170593,-0.03598915413022041,0.6052889823913574,-1.0255961418151855,0.02252366580069065,-0.28720295429229736,1.394748330116272,-0.6674969792366028,-0.46395182609558105,-1.1446926593780518,0.07095299661159515,-0.34484443068504333,0.23777367174625397,-0.06777061522006989,0.18430189788341522,-0.38437026739120483,-0.06888710707426071,0.15